/*
kpiData Attributes ->

kpiLabel -> Display Label for KPI
kpiValue -> Display Value for KPI
kpiSecondaryValue -> Display Secondary Value for KPI
isPositive -> To Display Positive or Negative Value
*/
a!localVariables(
  local!showInstanceRun: if(
    a!isNullOrEmpty(ri!tokenGrid),
    true(),
    false()
  ),
  local!avgAccuracyTrendUsage: #"SYSTEM_SYSRULES_queryRecordType_v1"(
    recordType: recordType!AIA Extraction Model,
    fields: #"SYSTEM_SYSRULES_aggregationFields"(
      measures: {
        #"SYSTEM_SYSRULES_forEach"(
          items: ri!selectedInterval.weeklyGroups,
          expression: #"SYSTEM_SYSRULES_measure"(
            field: recordType!AIA Extraction Model.publishedVersionAccuracy,
            function: "AVG",
            alias: concat("avgTrend", fv!index),
            filters: #"SYSTEM_SYSRULES_queryFilter"(
              field: recordType!AIA Extraction Model.createdOn,
              operator: "between",
              value: {
                rule!AIA_UTIL_convertDateToDateTime(
                  dateValue: ri!selectedInterval.weeklyGroups[fv!index].startDate,
                  isStartOfDay: true()
                ),
                rule!AIA_UTIL_convertDateToDateTime(
                  dateValue: ri!selectedInterval.weeklyGroups[fv!index].endDate,
                  isStartOfDay: false()
                )
              }
            )
          )
        )
      }
    ),
    pagingInfo: #"SYSTEM_SYSRULES_pagingInfo"(1, 1)
  ).data,
  local!extractionInstanceRun: #"SYSTEM_SYSRULES_queryRecordType_v1"(
    recordType: recordType!AIA Extraction Instance,
    fields: #"SYSTEM_SYSRULES_aggregationFields"(
      measures: {
        #"SYSTEM_SYSRULES_forEach"(
          items: ri!selectedInterval.weeklyGroups,
          expression: #"SYSTEM_SYSRULES_measure"(
            field: recordType!AIA Extraction Instance.id,
            function: "COUNT",
            alias: concat("instanceCount", fv!index),
            filters: {
              #"SYSTEM_SYSRULES_queryFilter"(
                field: recordType!AIA Extraction Instance.createdOn,
                operator: "between",
                value: {
                  rule!AIA_UTIL_convertDateToDateTime(
                    dateValue: ri!selectedInterval.weeklyGroups[fv!index].startDate,
                    isStartOfDay: true()
                  ),
                  rule!AIA_UTIL_convertDateToDateTime(
                    dateValue: ri!selectedInterval.weeklyGroups[fv!index].endDate,
                    isStartOfDay: false()
                  )
                }
              )
            }
          )
        )
      }
    ),
    pagingInfo: #"SYSTEM_SYSRULES_pagingInfo"(1, 1)
  ).data,
  local!classificationAccuracyTrendUsage: #"SYSTEM_SYSRULES_queryRecordType_v1"(
    recordType: recordType!AIA Classification Model,
    fields: #"SYSTEM_SYSRULES_aggregationFields"(
      measures: {
        #"SYSTEM_SYSRULES_forEach"(
          items: ri!selectedInterval.weeklyGroups,
          expression: #"SYSTEM_SYSRULES_measure"(
            field: recordType!AIA Classification Model.publishedAccuracy,
            function: "AVG",
            alias: concat("avgTrend", fv!index),
            filters: #"SYSTEM_SYSRULES_queryFilter"(
              field: recordType!AIA Classification Model.createdOn,
              operator: "between",
              value: {
                rule!AIA_UTIL_convertDateToDateTime(
                  dateValue: ri!selectedInterval.weeklyGroups[fv!index].startDate,
                  isStartOfDay: true()
                ),
                rule!AIA_UTIL_convertDateToDateTime(
                  dateValue: ri!selectedInterval.weeklyGroups[fv!index].endDate,
                  isStartOfDay: false()
                )
              }
            )
          )
        )
      }
    ),
    pagingInfo: #"SYSTEM_SYSRULES_pagingInfo"(1, 1)
  ).data,
  local!classificationInstanceRun: #"SYSTEM_SYSRULES_queryRecordType_v1"(
    recordType: recordType!AIA Classification Instance,
    fields: #"SYSTEM_SYSRULES_aggregationFields"(
      measures: {
        #"SYSTEM_SYSRULES_forEach"(
          items: ri!selectedInterval.weeklyGroups,
          expression: #"SYSTEM_SYSRULES_measure"(
            field: recordType!AIA Classification Instance.id,
            function: "COUNT",
            alias: concat("instanceCount", fv!index),
            filters: {
              #"SYSTEM_SYSRULES_queryFilter"(
                field: recordType!AIA Classification Instance.createdOn,
                operator: "between",
                value: {
                  rule!AIA_UTIL_convertDateToDateTime(
                    dateValue: ri!selectedInterval.weeklyGroups[fv!index].startDate,
                    isStartOfDay: true()
                  ),
                  rule!AIA_UTIL_convertDateToDateTime(
                    dateValue: ri!selectedInterval.weeklyGroups[fv!index].endDate,
                    isStartOfDay: false()
                  )
                }
              )
            }
          )
        )
      }
    ),
    pagingInfo: #"SYSTEM_SYSRULES_pagingInfo"(1, 1)
  ).data,
  local!weekLabels: #"SYSTEM_SYSRULES_forEach"(
    items: ri!selectedInterval.weeklyGroups,
    expression: a!localVariables(
      local!startDate: index(
        ri!selectedInterval.weeklyGroups,
        fv!index,
        null()
      ).startDate,
      local!endDate: index(
        ri!selectedInterval.weeklyGroups,
        fv!index,
        null()
      ).endDate,
      {
        label: concat(
          month(local!startDate),
          "/",
          day(local!startDate),
          " to ",
          month(local!endDate),
          "/",
          day(local!endDate)
        )
      }
    )
  ),
  #"SYSTEM_SYSRULES_cardLayout"(
    contents: {
      if(
        ri!isEmpty = true(),
        {
          #"SYSTEM_SYSRULES_sectionLayout_v1"(
            label: ri!modelLabel,
            labelSize: "SMALL",
            labelColor: ri!brandingMap.Gray4,
            contents: {
              #"SYSTEM_SYSRULES_imageField_v1"(
                labelPosition: "COLLAPSED",
                images: {
                  #"SYSTEM_SYSRULES_documentImage"(
                    document: cons!AIA_IMG_HOME_PAGE_EMPTY_IMAGE
                  )
                },
                size: "MEDIUM",
                isThumbnail: false,
                style: "STANDARD",
                align: "CENTER",
                marginBelow: "STANDARD"
              ),
              #"SYSTEM_SYSRULES_richTextDisplayField"(
                label: "",
                labelPosition: "COLLAPSED",
                value: {
                  #"SYSTEM_SYSRULES_richTextItem_v1"(
                    text: ri!emptyMessage,
                    color: ri!brandingMap.Gray3
                  )
                },
                align: "CENTER"
              )
            }
          )
        },
        {
          #"SYSTEM_SYSRULES_sectionLayout_v1"(
            label: ri!modelLabel,
            labelSize: "SMALL",
            labelColor: ri!brandingMap.Gray4,
            contents: {
              #"SYSTEM_SYSRULES_columnsLayout"(
                marginBelow: "NONE",
                columns: {
                  #"SYSTEM_SYSRULES_forEach"(
                    items: rule!AIA_UTIL_Filter(
                      records: ri!kpiData,
                      field: "isDisplay",
                      value: false(),
                      filterType: "REJECT"
                    ),
                    expression: #"SYSTEM_SYSRULES_columnLayout"(
                      contents: {
                        #"SYSTEM_SYSRULES_cardLayout"(
                          contents: {
                            #"SYSTEM_SYSRULES_richTextDisplayField"(
                              labelPosition: "COLLAPSED",
                              value: {
                                #"SYSTEM_SYSRULES_richTextItem_v1"(
                                  text: fv!item.kpiLabel,
                                  size: "STANDARD",
                                  color: ri!brandingMap.Gray4
                                ),
                                " ",
                                #"SYSTEM_SYSRULES_richTextIcon"(
                                  color: ri!brandingMap.Blue3,
                                  icon: "info-circle",
                                  caption: #"urn:appian:translation-string:v1:bb301535-de7e-42f7-9fa4-f001a24d34ed",
                                  showWhen: a!isNotNullOrEmpty(fv!item.kpiForthValue)
                                )
                              },
                              marginBelow: "LESS"
                            ),
                            #"SYSTEM_SYSRULES_richTextDisplayField"(
                              labelPosition: "COLLAPSED",
                              value: {
                                #"SYSTEM_SYSRULES_richTextItem_v1"(
                                  text: substitute(
                                    fixed(fv!item.kpiValue, 0, false),
                                    ",",
                                    ","
                                  ) & if(
                                    a!isNotNullOrEmpty(fv!item.KpiThirdValue),
                                    "%",
                                    {}
                                  ),
                                  size: "MEDIUM_PLUS",
                                  style: { "STRONG" },
                                  color: ri!brandingMap.Gray4
                                ),
                                #"SYSTEM_SYSRULES_richTextItem_v1"(
                                  text: " across " & fv!item.KpiThirdValue & " models",
                                  size: "STANDARD",
                                  showWhen: a!isNotNullOrEmpty(fv!item.KpiThirdValue),
                                  color: ri!brandingMap.Gray3
                                ),
                                #"SYSTEM_SYSRULES_richTextItem_v1"(
                                  text: " across " & fv!item.kpiForthValue & " pages",
                                  size: "STANDARD",
                                  showWhen: a!isNotNullOrEmpty(fv!item.kpiForthValue),
                                  color: ri!brandingMap.Gray3
                                )
                              },
                              marginBelow: "NONE"
                            ),
                            #"SYSTEM_SYSRULES_barChartField_v1"(
                              showWhen: a!isNotNullOrEmpty(fv!item.kpiForthValue),
                              labelPosition: "COLLAPSED",
                              series: {
                                #"SYSTEM_SYSRULES_chartSeries"(
                                  label: "Input Tokens",
                                  data: fv!item.KpiFithValue,
                                  color: "#03A9F4"
                                ),
                                #"SYSTEM_SYSRULES_chartSeries"(
                                  label: "Output Tokens",
                                  data: fv!item.KpiSixthValue,
                                  color: "#08088D"
                                )
                              },
                              colorScheme: "RAINFOREST",
                              stacking: "PERCENT_TO_TOTAL",
                              showLegend: true,
                              xAxisStyle: "NONE",
                              yAxisStyle: "NONE",
                              height: "MICRO"
                            ),
                            #"SYSTEM_SYSRULES_lineChartField_v1"(
                              showWhen: fv!item.kpiLabel = #"urn:appian:translation-string:v1:e7433e50-d077-40d2-b8d7-ece73c0d8e16",
                              categories: index(local!weekLabels, "label", null()),
                              series: {
                                #"SYSTEM_SYSRULES_chartSeries"(
                                  label: #"urn:appian:translation-string:v1:e7433e50-d077-40d2-b8d7-ece73c0d8e16",
                                  data: #"SYSTEM_SYSRULES_forEach"(
                                    items: enumerate(
                                      length(ri!selectedInterval.weeklyGroups)
                                    ) + 1,
                                    expression: rule!AIA_DisplayPercentage(
                                      value: if(
                                        rule!AIA_UTIL_isBlank(
                                          index(
                                            local!avgAccuracyTrendUsage,
                                            concat("avgTrend", fv!item),
                                            null()
                                          )
                                        ),
                                        0,
                                        round(
                                          index(
                                            local!avgAccuracyTrendUsage,
                                            concat("avgTrend", fv!item),
                                            null()
                                          ),
                                          2
                                        )
                                      )
                                    ),

                                  ),
                                  color: "ACCENT"
                                )
                              },
                              showLegend: false(),
                              showDataLabels: false(),
                              showTooltips: true(),
                              xAxisStyle: "STANDARD",
                              yAxisStyle: "NONE",
                              height: "MICRO"
                            ),
                            #"SYSTEM_SYSRULES_lineChartField_v1"(
                              showWhen: fv!item.kpiLabel = #"urn:appian:translation-string:v1:231c53d0-2ae0-4819-ae0a-372d31b4c766",
                              categories: index(local!weekLabels, "label", null()),
                              series: {
                                #"SYSTEM_SYSRULES_chartSeries"(
                                  label: #"urn:appian:translation-string:v1:231c53d0-2ae0-4819-ae0a-372d31b4c766",
                                  data: #"SYSTEM_SYSRULES_forEach"(
                                    items: enumerate(
                                      length(ri!selectedInterval.weeklyGroups)
                                    ) + 1,
                                    expression: if(
                                      rule!AIA_UTIL_isBlank(
                                        tointeger(
                                          index(
                                            local!extractionInstanceRun,
                                            concat("instanceCount", fv!item),
                                            null()
                                          )
                                        )
                                      ),
                                      0,
                                      tointeger(
                                        index(
                                          local!extractionInstanceRun,
                                          concat("instanceCount", fv!item),
                                          null()
                                        )
                                      )
                                    )
                                  ),
                                  color: "ACCENT"
                                )
                              },
                              showLegend: false(),
                              showDataLabels: false(),
                              showTooltips: true(),
                              xAxisStyle: "STANDARD",
                              yAxisStyle: "NONE",
                              height: "MICRO"
                            ),
                            #"SYSTEM_SYSRULES_lineChartField_v1"(
                              showWhen: fv!item.kpiLabel = #"urn:appian:translation-string:v1:c632a19b-3290-48a7-bd87-0c0e3bdbf347",
                              categories: index(local!weekLabels, "label", null()),
                              series: {
                                #"SYSTEM_SYSRULES_chartSeries"(
                                  label: #"urn:appian:translation-string:v1:c632a19b-3290-48a7-bd87-0c0e3bdbf347",
                                  data: #"SYSTEM_SYSRULES_forEach"(
                                    items: enumerate(
                                      length(ri!selectedInterval.weeklyGroups)
                                    ) + 1,
                                    expression: if(
                                      rule!AIA_UTIL_isBlank(
                                        round(
                                          index(
                                            local!classificationAccuracyTrendUsage,
                                            concat("avgTrend", fv!item),
                                            null()
                                          ),
                                          2
                                        )
                                      ),
                                      0,
                                      round(
                                        index(
                                          local!classificationAccuracyTrendUsage,
                                          concat("avgTrend", fv!item),
                                          null()
                                        ),
                                        2
                                      )
                                    ),

                                  ),
                                  color: "ACCENT"
                                )
                              },
                              showLegend: false(),
                              showDataLabels: false(),
                              showTooltips: true(),
                              xAxisStyle: "STANDARD",
                              yAxisStyle: "NONE",
                              height: "MICRO"
                            ),
                            #"SYSTEM_SYSRULES_lineChartField_v1"(
                              showWhen: fv!item.kpiLabel = #"urn:appian:translation-string:v1:b33f39d8-4522-4329-bf2b-d489dda7bb5d",
                              categories: index(local!weekLabels, "label", null()),
                              series: {
                                #"SYSTEM_SYSRULES_chartSeries"(
                                  label: #"urn:appian:translation-string:v1:b33f39d8-4522-4329-bf2b-d489dda7bb5d",
                                  data: #"SYSTEM_SYSRULES_forEach"(
                                    items: enumerate(
                                      length(ri!selectedInterval.weeklyGroups)
                                    ) + 1,
                                    expression: if(
                                      rule!AIA_UTIL_isBlank(
                                        tointeger(
                                          index(
                                            local!classificationInstanceRun,
                                            concat("instanceCount", fv!item),
                                            null()
                                          )
                                        )
                                      ),
                                      0,
                                      tointeger(
                                        index(
                                          local!classificationInstanceRun,
                                          concat("instanceCount", fv!item),
                                          null()
                                        )
                                      )
                                    )
                                  ),
                                  color: "ACCENT"
                                )
                              },
                              showLegend: false(),
                              showDataLabels: false(),
                              showTooltips: true(),
                              xAxisStyle: "STANDARD",
                              yAxisStyle: "NONE",
                              height: "MICRO"
                            ),

                          },
                          height: "SHORT_PLUS",
                          style: ri!brandingMap.DefaultPageBackground,
                          shape: "SEMI_ROUNDED",
                          padding: "STANDARD",
                          marginBelow: "STANDARD",
                          showBorder: false
                        )
                      }
                    )
                  )
                }
              )
            }
          ),
          #"SYSTEM_SYSRULES_columnsLayout"(
            marginAbove: "NONE",
            columns: {
              #"SYSTEM_SYSRULES_columnLayout"(
                contents: {
                  #"SYSTEM_SYSRULES_sectionLayout_v1"(
                    contents: {
                      #"SYSTEM_SYSRULES_sideBySideLayout"(
                        items: {
                          #"SYSTEM_SYSRULES_sideBySideItem"(
                            item: #"SYSTEM_SYSRULES_richTextDisplayField"(
                              accessibilityText: ri!modelSubLabel,
                              label: "",
                              labelPosition: "COLLAPSED",
                              value: {
                                #"SYSTEM_SYSRULES_richTextItem_v1"(
                                  text: ri!modelSubLabel,
                                  color: ri!brandingMap.Gray4,
                                  size: "MEDIUM"
                                )
                              }
                            )
                          ),
                          #"SYSTEM_SYSRULES_sideBySideItem"(
                            item: #"SYSTEM_SYSRULES_tagField"(
                              labelPosition: "COLLAPSED",
                              tags: {
                                #"SYSTEM_SYSRULES_tagItem_v1"(
                                  textColor: if(
                                    local!showInstanceRun,
                                    ri!brandingMap.Blue3,
                                    ri!brandingMap.White
                                  ),
                                  backgroundColor: if(
                                    local!showInstanceRun,
                                    ri!brandingMap.White,
                                    ri!brandingMap.Blue3
                                  ),
                                  text: #"urn:appian:translation-string:v1:ec270ab9-6512-48ea-a3d2-1040ee7259ce",
                                  link: #"SYSTEM_SYSRULES_dynamicLink"(
                                    value: false,
                                    saveInto: local!showInstanceRun
                                  )
                                ),
                                #"SYSTEM_SYSRULES_tagItem_v1"(
                                  textColor: if(
                                    local!showInstanceRun,
                                    ri!brandingMap.White,
                                    ri!brandingMap.Blue3
                                  ),
                                  backgroundColor: if(
                                    local!showInstanceRun,
                                    ri!brandingMap.Blue3,
                                    ri!brandingMap.White
                                  ),
                                  text: #"urn:appian:translation-string:v1:43850fbf-6b8f-4ed9-92a8-e4c584e1bd88",
                                  link: #"SYSTEM_SYSRULES_dynamicLink"(
                                    value: true(),
                                    saveInto: local!showInstanceRun
                                  )
                                )
                              }
                            ),
                            width: "MINIMIZE"
                          )
                        }
                      ),
                      if(
                        a!isNullOrEmpty(ri!extractionGrid),
                        {},
                        if(
                          local!showInstanceRun,
                          ri!extractionGrid,
                          if(
                            a!isNullOrEmpty(ri!tokenGrid),
                            rule!AIA_UTIL_NoDataAvailableForCharts(),
                            ri!tokenGrid
                          )
                        )
                      )
                    }
                  )
                },
                width: "10X"
              ),
              #"SYSTEM_SYSRULES_columnLayout"(
                contents: {
                  #"SYSTEM_SYSRULES_sectionLayout_v1"(
                    contents: {
                      #"SYSTEM_SYSRULES_richTextDisplayField"(
                        accessibilityText: #"urn:appian:translation-string:v1:660fd7ba-2b6e-4ec5-ab26-ad6396ed684e",
                        label: "",
                        labelPosition: "COLLAPSED",
                        value: {
                          #"SYSTEM_SYSRULES_richTextItem_v1"(
                            text: #"urn:appian:translation-string:v1:660fd7ba-2b6e-4ec5-ab26-ad6396ed684e",
                            color: ri!brandingMap.Gray4,
                            size: "MEDIUM"
                          )
                        }
                      ),
                      if(
                        a!isNullOrEmpty(ri!areaOfImprovementGrid),
                        {
                          #"SYSTEM_SYSRULES_cardLayout"(
                            style: ri!brandingMap.AppianBackground,
                            showBorder: false,
                            contents: {
                              #"SYSTEM_SYSRULES_richTextDisplayField"(
                                accessibilityText: #"urn:appian:translation-string:v1:2317da00-a8b6-4a21-af83-15bd1298044b",
                                labelPosition: "COLLAPSED",
                                marginAbove: "MORE",
                                marginBelow: "MORE",
                                align: "CENTER",
                                value: #"SYSTEM_SYSRULES_richTextItem_v1"(
                                  text: #"urn:appian:translation-string:v1:2317da00-a8b6-4a21-af83-15bd1298044b",
                                  color: ri!brandingMap.Gray3,
                                  size: "SMALL"
                                )
                              )
                            },
                            padding: "STANDARD",
                            marginAbove: "STANDARD"
                          )
                        },
                        ri!areaOfImprovementGrid
                      )
                    }
                  )
                },
                width: "6X"
              )
            },
            spacing: "SPARSE"
          )
        }
      )
    },
    shape: "SEMI_ROUNDED",
    padding: "STANDARD",
    marginBelow: "STANDARD",
    showBorder: false,
    showWhen: ri!showWhen = true()
  )
)
